(3815, 192192, 'yang', NULL, 'yangsong8374@gmail.com', '2013-08-28 00:00:00', '2013-10-07 00:00:00', '3', 2, 14, 'EE', 1, 'Second time to renew my H1B visa. Last year I used the CITIC drop-off service, which was quite successful and handy. This year I waited two weeks until I heard from the consulate that I need an interview. When I was there, I was check since then. So I wasted two weeks for nothing. Sucks.\r\n\r\nUpdate: I check the status on the website almost every day. First update was on Oct. 4, but still administrative processing. When checking again on Oct. 7, the status changed to "Issued". Bless all the checkees. Hope you guys clear soon. \r\n\r\nBTW, thank you, the website designer, you make us less helpless. Great job!', 'N/A', 'N/A', 'N/A', 4, 'N/A', 'N/A', 0, 'United States'),
