(6106, 227896, 'murthyh1b', NULL, '', '2013-11-05 00:00:00', '2013-11-26 00:00:00', '3', 1, 17, 'Computer Science', 1, 'Hi Fellow H-1B''s\r\n \r\nI attended my VISA on 5th NOV 2013 @ TORONTO.\r\n \r\nMy VISA officer is a lady & she asked me few questions, & then asked about my research work during my masters. I told every thing related to my work and then she asked my resume, I provided the soft copy of it. Later she asked me my I-20''s and she verified and then she talked with some one in the office & later issued a yellow and blue slip. \r\n\r\nThese are 221G forms, they asked me to send me the details concerning the exact nature of your field of study/research, CV, list of publications & source of funding. I send my Resume hard copy & publications to the email that was given to me.\r\n \r\nI did my masters in Computer Science & did my thesis in Visual cryptography (which deals with security)\r\n\r\nMy research work falls under TAL (Technology Alert List). I did my research under Cryptography.\r\n\r\n--------------------------------------------------------------------------------------------------\r\nHi Fellow H1-B''s,\r\n\r\nThe Biggest Thanks Giving Gift that United States given me this year.\r\n\r\nGot clearance email today at 12:32 PM. Once, after seeing the email - I took a deep breath & called my parents, after that I just ran to embassy to deliver my PP (Reached there at 3:00 PM, & I''m the last in the line)\r\n\r\nRequested to get the PP picked at embassy on Friday.\r\n\r\nShort Review of My story -\r\n\r\nInterview_Date: 11/05/2013\r\nCase Creation Date: 05-Nov-2013\r\nStatus Updated Date: 26-Nov-2013 (The date which I got clearance email)\r\n\r\nTotal_Waiting_Days: 22\r\n\r\nI will write a detailed review, when I find time (with all the research I have done, it will be helpful to every victim of 221G)', 'N/A', 'N/A', 'N/A', 1, 'N/A', 'N/A', 0, 'N/A'),
