(6334, 140786, 'ajn85830', NULL, 'ajn85829@gmail.com', '2013-06-28 00:00:00', '2013-08-23 00:00:00', '3', 2, 12, 'EE', 1, 'Here''s the progress:\r\n1) Got checked on 06/28.\r\n2) On the CEAC website, the "last updated date" was changed to 06/28 on the day 1 of the check.\r\n3) From then till 08/22 morning (Ottawa, local time 8AM), there''s finally an update on the website. It just says the "last updated data" was changed to 08/22, but the content is still about the under-going of administrative processing.\r\n4) I think the speculation on this site is accurate about the interval between "last update date" and the final clearance date of the visa. Because on the next 08/23 morning 8AM (Ottawa time), I got an email from the embassy that it''s approved.\r\n5) The email says to let me turn in my passport (you did have an option to leave the passport there or bring it with you on the interview day, for me I brought with me). So I went back to the embassy on 08/23 morning 10AM. They were supposed to deliver that to a local express mail service, but it turns out to be they just gave me a number and let me wait. After around 15 mins'' wait, they just printed it out and it''s all done. Surprisingly quick, so I''m good to fly back where I work in the States.\r\n\r\nAs I was stuck here in the Ottawa area for 8 weeks exactly, for any folks having similar experience, feel free to contact me at ajn85829@gmail.com. I can share the local surviving info with you. Good luck all (as well as the choice between staying here or flying back to your own country or some tourist option to the Atlantic provinces of this beautiful country) and again my deeply appreciation to this amazing checkee site. The info here definitely helped to make an estimation for their processing speed. Thanks!', 'N/A', 'N/A', 'N/A', 1, 'N/A', 'SDE', 6, 'N/A'),
