(6912, 334481, 'Scherzo', NULL, 'johnny_khc@hotmail.com', '2014-03-11 00:00:00', '2014-04-04 00:00:00', '1', 2, 1, 'Mechanical Engineering', 1, 'This is my fourth time applying for an US F1 Visa, never got checked before. I had interview for the first application and used Drop-off for the second and the third.  \r\n\r\n14-Feb-2014 Citic Bank Drop-off; Citic Bank clerk refused to take my CV, Study Plan and CV of my adviser because I was never checked before.  \r\n\r\n28-Feb-2014 Received 221(g) requiring Interview, CV, Study Plan, CV of my adviser and Invitation Letter; Unlocking my application fee receipt took 7 days. \r\n\r\n11-Mar-2014 Had interview in Beijing Consulate; VO took my CV, Study Plan, my adviser''s CV, but didn''t take the Invitation Letter. VO told me "You will have your VISA in two weeks". My return flight was scheduled on 11-Mar-2014.\r\n\r\nAdministrative Processing (Beijing Local Time)\r\n11-Mar-2014 Case Creation: AP\r\n25-Mar-2014 Status Updated: AP\r\n03-Apr-2014 Status Updated: AP\r\n04-Apr-2014 Status Updated: Issued\r\n\r\nIt took almost 50 days. Good luck to all the checkees, just hang in there and enjoy the time with your family. \r\n', 'N/A', 'N/A', 'N/A', 4, 'N/A', 'N/A', 4, 'N/A'),
