(9145, 370528, 'buaaer', NULL, 'xushuozhi@gmail.com', '2014-05-06 00:00:00', '2014-06-06 00:00:00', '1', 2, 14, 'ME', 1, 'Interviewed on May 6:\r\nI knew they would check me, as they did before, so I gave them everything but my advisor''s resume.\r\nConsulate called me on May 8:\r\nAsked for my advisor''s resume. I faxed it to them on the same day.\r\nFirst updated on June 5, still AP:\r\nI called the DOS the same day, they told me that the clearance was received, but not print yet.\r\nSecond updated on June 6:\r\nIssued.\r\n\r\nIt turns out all my materials are in Shanghai Consulate the whole time. It is my understanding that for a ''short'' 4-week check, the consulate updates the information, then inform the DOS. So no point to call the DOS if everything remains the same. By the way, DOS has a new number since the last year: 202-485-7600. Good luck to everyone!', 'Xu', 'Shuozhi', 'BUAA', 4, 'N/A', 'N/A', 3, 'China'),
